import React from 'react';
import { Navbar, Nav, NavDropdown, Button } from 'react-bootstrap';
import FullCalendar, { formatDate } from '@fullcalendar/react'
import dayGridPlugin from '@fullcalendar/daygrid'
import timeGridPlugin from '@fullcalendar/timegrid'
import interactionPlugin from '@fullcalendar/interaction'
import { INITIAL_EVENTS, createEventId } from './event-utils'


const App = () => {
    return (
        <div>
            <header>
                <Navbar bg="light" expand="lg">
                    <Navbar.Brand href="#home" style={{ margin: "0 30px 0 10px" }}>TimeFlex</Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="ml-auto">
                            <Button variant="outline-secondary" style={{ margin: "0 10px 0 10px" }}>Today</Button>
                            <NavDropdown title="Dropdown" id="basic-nav-dropdown" style={{ margin: "0 10px 0 10px" }}>
                                <NavDropdown.Item href="#action/3.1">Day</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.2">Week</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.3">Month</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.3">Year</NavDropdown.Item>
                            </NavDropdown>
                        </Nav>
                    </Navbar.Collapse>
                </Navbar>
            </header>
            <body>
                <div className='demo-app-main'>
                    <FullCalendar
                        plugins={[dayGridPlugin, timeGridPlugin, interactionPlugin]}
                        headerToolbar={{
                            left: 'prev,next today',
                            center: 'title',
                            right: 'dayGridMonth,timeGridWeek,timeGridDay'
                        }}
                        initialView='dayGridMonth'
                        editable={true}
                        selectable={true}
                        selectMirror={true}
                        dayMaxEvents={true}
                        weekends={this.state.weekendsVisible}
                        fixedWeekCount={false}
                        height={"100%"}
                        initialEvents={INITIAL_EVENTS} // alternatively, use the `events` setting to fetch from a feed
                        select={this.handleDateSelect}
                        eventContent={renderEventContent} // custom render function
                        eventClick={this.handleEventClick}
                        eventsSet={this.handleEvents} // called after events are initialized/added/changed/removed
                    /* you can update a remote database when these fire:
                    eventAdd={function(){}}
                    eventChange={function(){}}
                    eventRemove={function(){}}
                    */
                    />
                </div>
            </body>
        </div >

    );
}

export default App;
